window.bookSummaryJSON = "<p><b><i>From author Jescie Hall, comes this powerful and emotional contemporary romance featuring a young girl being torn from her perfect, calculated little world, reluctantly falling for her new ex-convict roommate, Hawke, unearthing the truth behind his hidden past.</i></b><br> <br> Nicole never imagined anyone other than her seemingly perfect boyfriend, Patrick, could grab her attention. That is, until ex-convict Cameron Hawke unexpectedly becomes their roommate, turning her entire, calculated little world upside down.<br> <br> The tension in the house is thick as Hawke's lifestyle clashes abruptly with hers. Nicole's curiosities get the best of her as she attempts to learn the secrets behind Hawke's mysterious past.<br> <br> Temptations become overwhelming as lines get crossed, feelings get blurry and the truth to a horrific past is unearthed, changing the lives of the three of them forever.</p>"; 
